import React from 'react';
import { Heart } from 'lucide-react';

const CreateDonation = () => {
  return (
    <div className="p-6 max-w-7xl mx-auto">
      <div className="mb-6">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Create Donation</h1>
        <p className="text-gray-600">Post items for NGO pickup</p>
      </div>

      <div className="card">
        <div className="text-center py-12">
          <div className="w-24 h-24 bg-gray-100 rounded-full flex items-center justify-center mx-auto mb-4">
            <Heart className="w-12 h-12 text-gray-400" />
          </div>
          <h3 className="text-lg font-medium text-gray-900 mb-2">Create Donation Page</h3>
          <p className="text-gray-500">This page will have a form to create donation posts for NGOs to request.</p>
        </div>
      </div>
    </div>
  );
};

export default CreateDonation;
